import React, { Component } from 'react';
import { VerticalBarSeries, LabelSeries, RadarChart } from 'react-vis';
import './graph_styling.css'

class Genre_Analysis extends Component {
    constructor(props) {
        super(props);
    }
    render() {
        return (
            <div>
                <RadarChart
                   data={this.props.radarData}
                   domains={[
                    {name: 'pop', domain: [0, 100]},
                    {name: 'rap', domain: [0, 100]},
                    {name: 'rock', domain: [0, 100]},
                  ]}
                  height={300}
                  width={400} 
                >
                </RadarChart>
            </div>
        );
    }
}

export default Genre_Analysis;
